import React from "react";
import { Navbar, Nav, Form, FormControl } from "react-bootstrap";
import { FaBars, FaSearch, FaPlusCircle } from "react-icons/fa";

const CustomNavbar = () => (
  <Navbar bg="light" expand="lg" className="p-2">
    <FaBars className="me-3" />
    <FaPlusCircle className="text-danger me-2" />
    <Navbar.Brand className="me-auto fw-bold">Emergency</Navbar.Brand>
    <Form className="d-flex w-100">
      <FormControl type="search" placeholder="Search" className="me-2" />
    </Form>
    <div className="ms-auto p-2">üÖøÔ∏è</div>
  </Navbar>
);

export default CustomNavbar;
